BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_emailconfirmation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "sent" datetime NULL, "key" varchar(64) NOT NULL UNIQUE, "email_address_id" integer NOT NULL REFERENCES "account_emailaddress" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_emailaddress" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "verified" bool NOT NULL, "primary" bool NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "email" varchar(254) NOT NULL);
CREATE TABLE IF NOT EXISTS "accounts_languages" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "lang_name" varchar(50) NOT NULL UNIQUE, "lang_abbr" varchar(2) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "accounts_child" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "chld_name" varchar(100) NULL, "chld_surname" varchar(100) NULL, "chld_birthdate" date NOT NULL, "chld_gender" varchar(10) NOT NULL, "chld_spcl_attention" text NULL, "chld_seat" bool NOT NULL, "chld_user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_profile_languages" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "profile_id" bigint NOT NULL REFERENCES "accounts_profile" ("id") DEFERRABLE INITIALLY DEFERRED, "languages_id" bigint NOT NULL REFERENCES "accounts_languages" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_review" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rating" integer NOT NULL, "comment" text NULL, "created_at" datetime NOT NULL, "reviewed_user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "reviewer_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "socialaccount_socialapp" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "provider" varchar(30) NOT NULL, "name" varchar(40) NOT NULL, "client_id" varchar(191) NOT NULL, "secret" varchar(191) NOT NULL, "key" varchar(191) NOT NULL, "provider_id" varchar(200) NOT NULL, "settings" text NOT NULL CHECK ((JSON_VALID("settings") OR "settings" IS NULL)));
CREATE TABLE IF NOT EXISTS "socialaccount_socialtoken" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "token" text NOT NULL, "token_secret" text NOT NULL, "expires_at" datetime NULL, "account_id" integer NOT NULL REFERENCES "socialaccount_socialaccount" ("id") DEFERRABLE INITIALLY DEFERRED, "app_id" integer NULL REFERENCES "socialaccount_socialapp" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "socialaccount_socialaccount" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "provider" varchar(200) NOT NULL, "uid" varchar(191) NOT NULL, "last_login" datetime NOT NULL, "date_joined" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "extra_data" text NOT NULL CHECK ((JSON_VALID("extra_data") OR "extra_data" IS NULL)));
CREATE TABLE IF NOT EXISTS "trajects_traject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "start_adress" varchar(255) NOT NULL, "end_adress" varchar(255) NOT NULL, "start_street" varchar(100) NULL, "start_cp" varchar(10) NULL, "start_locality" varchar(100) NULL, "end_street" varchar(100) NULL, "end_cp" varchar(10) NULL, "end_locality" varchar(100) NULL, "start_coordinate" varchar(50) NULL, "end_coordinate" varchar(50) NULL, "start_country" varchar(100) NULL, "end_country" varchar(100) NOT NULL, "distance" real NULL);
CREATE TABLE IF NOT EXISTS "trajects_transportmode" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "description" text NULL);
CREATE TABLE IF NOT EXISTS "trajects_proposedtraject_languages" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "proposedtraject_id" bigint NOT NULL REFERENCES "trajects_proposedtraject" ("id") DEFERRABLE INITIALLY DEFERRED, "languages_id" bigint NOT NULL REFERENCES "accounts_languages" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "trajects_proposedtraject_transport_modes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "proposedtraject_id" bigint NOT NULL REFERENCES "trajects_proposedtraject" ("id") DEFERRABLE INITIALLY DEFERRED, "transportmode_id" bigint NOT NULL REFERENCES "trajects_transportmode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "trajects_reservation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "number_of_places" integer unsigned NOT NULL CHECK ("number_of_places" >= 0), "reservation_date" datetime NOT NULL, "status" varchar(20) NOT NULL, "traject_id" bigint NOT NULL REFERENCES "trajects_proposedtraject" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "trajects_researchedtraject_children" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "researchedtraject_id" bigint NOT NULL REFERENCES "trajects_researchedtraject" ("id") DEFERRABLE INITIALLY DEFERRED, "child_id" bigint NOT NULL REFERENCES "accounts_child" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "trajects_researchedtraject_transport_modes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "researchedtraject_id" bigint NOT NULL REFERENCES "trajects_researchedtraject" ("id") DEFERRABLE INITIALLY DEFERRED, "transportmode_id" bigint NOT NULL REFERENCES "trajects_transportmode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "trajects_reservation_transport_modes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "reservation_id" bigint NOT NULL REFERENCES "trajects_reservation" ("id") DEFERRABLE INITIALLY DEFERRED, "transportmode_id" bigint NOT NULL REFERENCES "trajects_transportmode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "strip_subscription" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stripe_customer_id" varchar(255) NULL, "stripe_subscription_id" varchar(255) NULL, "is_active" bool NOT NULL, "current_period_start" datetime NULL, "current_period_end" datetime NULL, "created_at" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "stripe_subscription" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stripe_customer_id" varchar(255) NULL, "stripe_subscription_id" varchar(255) NULL, "is_active" bool NOT NULL, "current_period_start" datetime NULL, "current_period_end" datetime NULL, "created_at" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "stripe_sub_subscription" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stripe_customer_id" varchar(255) NULL, "stripe_subscription_id" varchar(255) NULL, "is_active" bool NOT NULL, "current_period_start" datetime NULL, "current_period_end" datetime NULL, "created_at" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "price" decimal NULL, "first_name" varchar(100) NULL, "last_name" varchar(100) NULL, "product_name" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "accounts_profile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "profile_picture" varchar(100) NULL, "address" varchar(100) NOT NULL, "service" varchar(30) NOT NULL, "transport_modes" text NOT NULL CHECK ((JSON_VALID("transport_modes") OR "transport_modes" IS NULL)), "bio" text NOT NULL, "phone" varchar(15) NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "document_image_url" varchar(200) NULL, "verified_address" text NULL CHECK ((JSON_VALID("verified_address") OR "verified_address" IS NULL)), "verified_first_name" varchar(100) NULL, "verified_last_name" varchar(100) NULL, "verified_dob" text NULL CHECK ((JSON_VALID("verified_dob") OR "verified_dob" IS NULL)), "ci_is_verified" bool NOT NULL, "bvm_is_verified" bool NOT NULL, "prfl_is_verified" bool NOT NULL, "document_bvm" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "bug_tracker_component" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "bug_tracker_environment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "description" text NOT NULL);
CREATE TABLE IF NOT EXISTS "bug_tracker_version" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "release_date" date NULL, "is_active" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "bug_tracker_bugattachment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "file" varchar(100) NOT NULL, "filename" varchar(255) NOT NULL, "uploaded_at" datetime NOT NULL, "bug_id" bigint NOT NULL REFERENCES "bug_tracker_bug" ("id") DEFERRABLE INITIALLY DEFERRED, "uploaded_by_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bug_tracker_bugcomment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "author_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "bug_id" bigint NOT NULL REFERENCES "bug_tracker_bug" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bug_tracker_bughistory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "field_changed" varchar(50) NOT NULL, "old_value" text NOT NULL, "new_value" text NOT NULL, "timestamp" datetime NOT NULL, "bug_id" bigint NOT NULL REFERENCES "bug_tracker_bug" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bug_tracker_bug" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(200) NOT NULL, "description" text NOT NULL, "status" varchar(20) NOT NULL, "priority" varchar(20) NOT NULL, "severity" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "operating_system" varchar(100) NOT NULL, "browser" varchar(100) NOT NULL, "device" varchar(100) NOT NULL, "assigned_to_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "reported_by_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "component_id" bigint NOT NULL REFERENCES "bug_tracker_component" ("id") DEFERRABLE INITIALLY DEFERRED, "environment_id" bigint NOT NULL REFERENCES "bug_tracker_environment" ("id") DEFERRABLE INITIALLY DEFERRED, "affected_version_id" bigint NOT NULL REFERENCES "bug_tracker_version" ("id") DEFERRABLE INITIALLY DEFERRED, "fixed_version_id" bigint NULL REFERENCES "bug_tracker_version" ("id") DEFERRABLE INITIALLY DEFERRED, "reproduction_steps" text NULL);
CREATE TABLE IF NOT EXISTS "bana_admin_inscriptionvalidation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "is_validated" bool NOT NULL, "validation_date" datetime NULL, "notes" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "trajects_proposedtraject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "departure_time" time NULL, "arrival_time" time NULL, "number_of_places" smallint unsigned NOT NULL CHECK ("number_of_places" >= 0), "details" text NULL, "detour_distance" real NULL, "recurrence_type" varchar(30) NOT NULL, "recurrence_interval" integer NULL, "recurrence_days" varchar(255) NULL, "date" date NULL, "date_debut" date NULL, "date_fin" date NULL, "is_simple" bool NOT NULL, "user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "traject_id" bigint NOT NULL REFERENCES "trajects_traject" ("id") DEFERRABLE INITIALLY DEFERRED, "is_active" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "trajects_researchedtraject" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "departure_time" time NOT NULL, "arrival_time" time NOT NULL, "date" date NULL, "date_debut" date NULL, "date_fin" date NULL, "recurrence_type" varchar(30) NOT NULL, "recurrence_interval" integer NULL, "recurrence_days" varchar(255) NULL, "user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "traject_id" bigint NOT NULL REFERENCES "trajects_traject" ("id") DEFERRABLE INITIALLY DEFERRED, "is_active" bool NOT NULL);
